import React from 'react';
import './index.css';
import './styles.css'

export default function ListingAd({ pic, title, address, description }) {
  return (
    <div className="App">
      <img className="" src={pic} />
      <div className='p-5'>
        <div className='flex flex-row'>
          <img src={pic} style={{height: 40, width: 40}}/>
          <div className='flex flex-col text-start p'>
            <div>{title}</div>
            <div>{address}</div>
          </div>
        </div>
      </div>
    </div>
  );
}
